import React from "react";

export default function Services() {
  return (
    <div className="services-container">
      <div className="services-list-conainer">
        {/* desc */}
        <div className="services-desc-container">
          <h1>
            {" "}
            What I <span> Deliver</span>
          </h1>
          <p>
            Creating scalable web applications and designing user-friendly
            interfaces.
          </p>
          <button>Hire me!</button>
        </div>
        {/* items */}
        <div className="services-items-container">
          <div className="srvices-items">
            <i className="fa-sold fa-code"></i>
          </div>
        </div>
      </div>
    </div>
  );
}
